import React, { useEffect, useState } from "react";
import useStateRef from "react-usestateref";

const ViewQuestion = () => {
  const [list, setListQuestions, refListQuestions] = useStateRef();

  useEffect(() => {
    fetchCall();
  }, []);

  function fetchCall() {
    fetch("https://localhost:8443/onlineexamapplication/control/viewQuestions")
      .then((res) => res.json())
      .then((data) => {
        var questionList = data.questionList;
       
        setListQuestions(questionList);
        // console.log("DATA", data);
        // var resultdata = data.questionList;
        // console.log("RESULT DATA ", resultdata);
        // setListQuestions(resultdata);
      });
  }

  console.log("LIST ", list);

  list && list.map((l)=>{
    console.log(l.questionId);
    console.log(l.questionDetail)
  })

  return (
    <>
      <table class="table table-dark table-striped">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">First</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
      </table>
    </>
  );
};

export default ViewQuestion;
